import QuizSetup from './QuizSetupPage.js';
import './App.css';
import { useState } from 'react';




function NavBar(){
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>My Quizzes</li>
        <li>Settings</li>
      </ul>
    </nav>
  )
}
function Header(){
  return (
    <header>
      <h1>Quizzitch</h1>
      <NavBar/>
    </header>
  )
}

function Button({btnName, btnId}){
  return (
    <button id={btnId}>
      {btnName}
    </button>
  )
}


function SearchBar ({searchBarId}){
  return (
      <input id={searchBarId} type="text" placeholder="Search..."/>
  )
}

function Footer(){
  return(
    <p>&copy; shauvia</p>
  )
}



function App() {
  return (
    <>
      <Header/>
      <div className='homePage'>
        <Button btnId='btnCreateNewQuiz' btnName={"Create New Quiz"}></Button>
        <Button btnId="btnRecentQuizes" btnName={"Recent Quizes"}></Button>
        <SearchBar searchBarId='SearchBar'/>
      </div>
      {/* <div className='quizSetupPage'>
        <QuizSetup/>
      </div> */}

      <Footer/>
    </>
  )
}

